pragma solidity ^0.5.0;

import "./external/DelegatedWallet.sol";
import "./external/ERC20Token.sol";
import "./external/Payable.sol";

contract ITransactionRequest {
    // Primary actions
    function execute() public returns (bool);
    function cancel() public returns (bool);
    function claim() public payable returns (bool);

    // Proxy function
    function proxy(address recipient, bytes memory callData) public payable returns (bool);

    // Data accessors
    function requestData() public view returns (address[6] memory, bool[3] memory, uint[15] memory, uint8[1] memory);
    function callData() public view returns (bytes memory);

    // Pull mechanisms for payments.
    function refundClaimDeposit() public returns (bool);
    function sendFee() public returns (bool);
    function sendBounty() public returns (bool);
    function sendOwnerEther() public returns (bool);
    function sendOwnerEther(address recipient) public returns (bool);

    event Aborted(uint8 reason);
    event Cancelled(uint rewardPayment, uint measuredGasConsumption);
    event Claimed();
    event Executed(uint bounty, uint fee, uint measuredGasConsumption);
}

contract ITransactionRequestFactory {
    function createTransactionRequest (address wallet, uint[7] memory options) public payable returns (ITransactionRequest);
}

contract ITransactionDelegate {
  function transfer (address token, address payable recipient, uint amount) public returns (bool success);
  function call (address callAddress, uint callValue, bytes memory callData) public returns (bool success, bytes memory returnData);
  function schedule (IFutureTransaction transaction) public returns (bool success);
  function unschedule (IFutureTransaction transaction) public returns (bool success);
  function clear () public returns (bool success);
  function valid (IFutureTransaction transaction) public view returns (bool);
  function getTransactionList (IDelegatedWallet wallet) public view returns (address[] memory);
  function getTotalTransactions (IDelegatedWallet wallet) public view returns (uint);
  function getTransactionAtIndex (IDelegatedWallet wallet, uint i) public view returns (IFutureTransaction);
  function getIndexOf (IFutureTransaction transaction) public view returns (uint);
}

contract IFutureTransaction {
    IDelegatedWallet public wallet;
    ITransactionDelegate public delegate;
}

contract IRecurringTransaction is IFutureTransaction {
    ITransactionRequest public executor;
    ITransactionRequestFactory public factory;
    uint public currentInterval;
    address public callAddress;
    bytes public callData;
    uint[4] public rtxOptions;          // [callValue,  intervalValue, intervalUnit, maxIntervals]
    uint[7] public txRequestOptions;    // [claimWindow, freezeIntervalDuration, reserveWindowSize, executionWindow, timestamp, callGas, deposit]
}

contract IRecurringTransactionFactory {

    function createRecurringTransaction (
        IDelegatedWallet wallet,
        ITransactionDelegate delegate,
        ITransactionRequestFactory factory
    ) public returns (IRecurringTransaction);

    function createAndStartRecurringTransaction (
        IDelegatedWallet wallet,
        ITransactionDelegate delegate,
        ITransactionRequestFactory factory,
        address callAddress,
        bytes memory callData,
        uint[4] memory callOptions,
        uint[7] memory txRequestOptions
    ) public returns (IRecurringTransaction);

}
